import React from 'react';

function Tabla({ datos }) {
    return (
        <div id="tabla-container" className="px-4">
            <table className="table table-hover" style={{ backgroundColor: 'transparent', borderCollapse: 'separate', borderSpacing: '0 8px' }}>
                <thead>
                    <tr>
                        <th scope="col" className="fs-3" style={{ backgroundColor: '#FDFBF6', borderBottom: 'none' }}>Modelo</th>
                        <th scope="col" className="fs-3" style={{ backgroundColor: '#FDFBF6', borderBottom: 'none' }}>Nombre</th>
                    </tr>
                </thead>
                <tbody>
                    {datos.map(({ id_carrera, modelo, nombre_carrera }) => (
                        <tr key={id_carrera} style={{ borderBottom: '2px solid #000' }} data-id={id_carrera}>
                            <th className="fs-4" style={{ backgroundColor: '#FDFBF6' }}>{modelo}</th>
                            <th className="fs-4" style={{ backgroundColor: '#FDFBF6' }}>{nombre_carrera}</th>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Tabla;
